import React from 'react';
import classes from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = (props) => {

    let postData = [
        {id: 1, message: 'Hi, how are you?', likesCount: 3},
        {id: 2, message: 'It\'s my first post', likesCount: 6},
        {id: 3, message: 'It\'s my second post', likesCount: 0},
        {id: 4, message: 'It\'s my second post', likesCount: 10},
        {id: 5, message: 'It\'s my second post', likesCount: 4}
    ];

    return (
    <div>
        <div>
            My post
        </div>
        <div>
            <textarea></textarea>
            <button>Post</button>
        </div>
        <Post message={postData[0].message} likesCount={postData[0].likesCount}/>
        <Post message={postData[1].message} likesCount={postData[1].likesCount}/>
        <Post message={postData[2].message} likesCount={postData[2].likesCount}/>
        <Post message={postData[3].message} likesCount={postData[3].likesCount}/>
        <Post message={postData[4].message} likesCount={postData[4].likesCount}/>
    </div>
    );
}

export default MyPosts;
